class S2Runtime {
	constructor(canvas){
		this.Project = {
			"name": "",
			"sprites": {
				"_stage_": {
					"scripts": [],
					"costumes": [
						{
							"name": "backdrop1",
							"data": ""
						}
					],
					"sounds": [
						{
							"name": "pop",
							"data": ""
						}
					]
				}
			}
		}
	}
	newSprite(name, data=""){
		this.Project.sprites[name] = data == "" ? {
			"scripts": [],
			"costumes": [],
			"sounds": []
		} : data
	}
	setScript(spritename, scriptdata){
		this.Project.sprites[name].scripts = scriptdata
	}
	addCostume(spritename, name, data){
		this.Project.sprites[name].costumes.add(scriptdata)
	}
}